import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for listings to load and find jun_2 listing card
    await page.waitForSelector('[data-listing-id="jun_2"]', { timeout: 10000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_listings_loaded.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_listings_loaded.png'));

    // Click on jun_2 listing card using multiple selector strategies
    const jun2Card = await page.$('[data-listing-id="jun_2"]');
    if (jun2Card) {
      await jun2Card.click();

      // Wait for modal to appear with multiple fallback strategies
      await Promise.race([
        page.waitForSelector('.modal-overlay', { state: 'visible', timeout: 5000 }),
        page.waitForSelector('#modal-title', { state: 'visible', timeout: 5000 }),
        page.waitForSelector('.modal-content', { state: 'visible', timeout: 5000 })
      ]);

      await page.screenshot({ path: path.join(screenshotsDir, 'step_3_modal_opened.png') });
      screenshots.push(path.join(screenshotsDir, 'step_3_modal_opened.png'));

      // Extract modal title text
      const modalTitle = await page.$eval('#modal-title', el => el.textContent.trim());

      // Verify modal title is displayed correctly
      const isTitleVisible = await page.$eval('#modal-title', el => {
        const style = window.getComputedStyle(el);
        return style.display !== 'none' && style.visibility !== 'hidden' && el.offsetParent !== null;
      });

      return {
        success: true,
        action: "Clicked jun_2 listing card and verified modal title is displayed correctly",
        extractedData: {
          modalTitle: modalTitle,
          isTitleVisible: isTitleVisible
        },
        screenshots,
        error: null
      };
    } else {
      throw new Error('jun_2 listing card not found');
    }
  } catch (error) {
    await page.screenshot({ path: path.join(screenshotsDir, 'error.png') });
    screenshots.push(path.join(screenshotsDir, 'error.png'));

    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}

